function nospaces(a){form=document.getElementById("form");t=form.get(a);if(t.value.match(/\s/g)){t.value=t.value.replace(" ","")}}$(document).ready(function(){$('[data-toggle="tooltip"]').tooltip()});var options=[];$(".dropdown-menu.check-form label").on("click",function(d){var b=$(d.currentTarget),f=b.attr("data-value"),e=b.find("input"),c=b.find("label").prevObject[0],a;console.log(c);if((a=options.indexOf(f))>-1){options.splice(a,1);c.classList.add("deselected");c.classList.remove("selected");setTimeout(function(){e.prop("checked",false)},0)}else{options.push(f);c.classList.add("selected");c.classList.remove("deselected");setTimeout(function(){e.prop("checked",true)},0)}$(d.target).blur();console.log(options);return false});